const vm = new Vue({
    el:"#intro",
    data:{
        name:"",
        photo:"",
        castels:[{
            id:1,
            name:"Castelo de Bragança",
            year:1439,
            photo:"data:image/jpeg;base64,"
        },
        {
            id:2,
            name:"Castelo de Almourol",
            year:1171,
            photo:"data:image/jpeg;base64,"
        },
        {
            id:3,
            name:"Castelo de Marvão",
            year:1300,
            photo:"data:image/jpeg;base64,"
        },
        {
            id:4,
            name:"Castelo de Montalegre",
            year:1325,
            photo:"data:image/jpeg;base64,",
        },
        {
            id:5,
            name:"Castelo de Sortelha",
            year:1228,
            photo:"data:image/jpeg;base64,"
        },
        {
            id:6,
            name:"Castelo de Arraiolos",
            year:1306,
            photo:"data:image/jpeg;base64,"
        },
        {
            id:7,
            name:"Castelo de Santa Maria da Feira",
            year:1200,
            photo:"data:image/jpeg;base64,"
        },
        {
            id:8,
            name:"Castelo de Lindoso",
            year:1258,
            photo:"data:image/jpeg;base64,"
        },
        {
            id:9,
            name:"Castelo dos Mouros",
            year:1093,
            photo:"data:image/jpeg;base64,"
        },
        {
            id:10,
            name:"Castelo de Guimarães",
            year:958,
            photo:"data:image/jpeg;base64,"
        }
    ],
    filterName:"",

    },
    methods:{
        getLastId(){
            if(this.vastels.length){
                return this.travels[this.travels.length-1].id
            }
            else{
                return 0

                
            }
            
        },
        addCastle(){
            this.castels.push({
                id:this.getLastId()+1,
                name:this.name, 
                photo:this.photo
            })
        },
        changeCastel(id){
            const index = this.castels.findIndex(
                (castel)=> castel.id === id
            )
            this.castels[index].name = prompt("Mudar Nome do Castelo", this.castels[index].name)
        },
        //Function para abrir modal
        image(id){
            const index = this.castels.findIndex(
                (castel)=> castel.id === id
            )
            const dlgReport = document.getElementById("dlgReport")
            dlgReport.innerHTML=`
            <img src="${this.castels[index].photo}">  </img> 
            <button @click="${this.closeImage()}" class="btn btn-primary">FECHAR</button>
            `
    
            dlgReport.showModal()
        },
        //Fechar modal
        closeImage(){
            document.getElementById("dlgReport").close()
        },
        compareCastel(a,b){
            if(a.name < b.name) return -1
            if(a.name > b.name) return 1
            else return 0
        },
        orderByName(){
            this.castels.sort(this.compareCastel)
        },
        removeCastel(id){
            if(confirm("Deseja mesmo remover o castelo?")){
                this.castels = this.castels.filter((castel)=> castel.id !== id
                )
            }
        },
        arrayManipulation(op){
            switch(op){
                case "1":
                    //REMOVE A PALAVRA CASTELO
                const str = "Castelo"
                this.castels = this.castels.map(
                castel => {
                    castel.name =castel.name.replace(str,"")
                    return castel
                }
            )
            break;
            case "2":
                const average = this.castels.reduce(
                    (sum, cur) => sum + cur.year, 0) / this.castels.length
                    alert(`A média da data de construção é ${average}`)
                    break;
    }
}
    },
    computed:{
        filteredCastels(){
            return this.castels.filter(
                (castel) =>{
                    let filterNameResult = true

                    if(this.filterName !== ""){
                        filterNameResult = castel.name === this.filterName
                    }
                    return filterNameResult
                }
            )
        }

    }

})